(1, 105, 'A FEW WORDS ABOUT US&#13;&#10; &#13;&#10; Gyant is an environmental compliance company focused on emissions tracking, reporting and carbon footprint management.&#13;&#10; &#13;&#10; The company operates and maintains a web-based VOC and CO2 Monitoring &#38; Tracking System &#13;&#10; to assist clients in complying with governmental regulations and guidelines.&#13;&#10; The web application also complies with COSHH, HAPS, and HSE regulations.&#13;&#10; &#13;&#10; VOC WEB MANAGER streamlines monitoring and reporting in real time at any time.', 'A FEW WORDS ABOUT US&#13;&#10; &#13;&#10; Gyant is an environmental compliance company focused on emissions tracking, reporting and carbon footprint management.&#13;&#10; &#13;&#10; The company operates and maintains a web-based VOC and CO2 Monitoring &#38; Tracking System &#13;&#10; to assist clients in complying with governmental regulations and guidelines.&#13;&#10; The web application also complies with COSHH, HAPS, and HSE regulations.&#13;&#10; &#13;&#10; VOC WEB MANAGER streamlines monitoring and reporting in real time at any time.'),
